import React from 'react';
import { styled } from 'styled-components';

const Button = styled.div`
  position: fixed;
  width: 100px;
  height: 100px;
  border: 1px solid red;
`;

const AsideBtn = () => {
  return (
    <Button>
      <img src='https://cf.channel.io/file/18747/5f06c984f2892569fcd1/file.png'/>
    </Button>
  )
}

export default AsideBtn;
